import React, { useState, useEffect } from 'react';
import axios from 'axios';

const SurveyResponse = () => {
    const [facultades, setFacultades] = useState([]);
    const [carreras, setCarreras] = useState([]);
    const [profesores, setProfesores] = useState([]);
    const [asignaturas, setAsignaturas] = useState([]);
    const [selectedFacultad, setSelectedFacultad] = useState('');
    const [selectedCarrera, setSelectedCarrera] = useState('');
    const [selectedProfesor, setSelectedProfesor] = useState('');
    const [selectedAsignatura, setSelectedAsignatura] = useState('');

    useEffect(() => {
        // Obtener todas las facultades
        axios.get('http://localhost:8087/facultades')
            .then(response => setFacultades(response.data))
            .catch(error => console.error('Error fetching facultades:', error));
    }, []);

    useEffect(() => {
        if (selectedFacultad) {
            // Obtener carreras por facultad seleccionada
            axios.get(`http://localhost:8087/carreras?idFacultad=${selectedFacultad}`)
                .then(response => setCarreras(response.data))
                .catch(error => console.error('Error fetching carreras:', error));
        } else {
            setCarreras([]);
        }
    }, [selectedFacultad]);

    useEffect(() => {
        if (selectedCarrera) {
            // Obtener asignaturas por carrera seleccionada
            axios.get(`http://localhost:8087/asignaturas?idCarrera=${selectedCarrera}`)
                .then(response => setAsignaturas(response.data))
                .catch(error => console.error('Error fetching asignaturas:', error));
        } else {
            setAsignaturas([]);
        }
    }, [selectedCarrera]);

    useEffect(() => {
        if (selectedAsignatura) {
            // Obtener profesores por asignatura seleccionada
            axios.get(`http://localhost:8087/profesores/asignatura/${selectedAsignatura}`)
                .then(response => setProfesores(response.data))
                .catch(error => console.error('Error fetching profesores:', error));
        } else {
            setProfesores([]);
        }
    }, [selectedAsignatura]);

    const handleSubmit = () => {
        // Aquí puedes manejar la lógica para buscar y mostrar las encuestas basadas en los filtros seleccionados
        console.log('Facultad:', selectedFacultad);
        console.log('Carrera:', selectedCarrera);
        console.log('Asignatura:', selectedAsignatura);
        console.log('Profesor:', selectedProfesor);
    };

    return (
        <div>
            <h2>Responder Encuesta</h2>
            <div>
                <label>Profesor:</label>
                <select value={selectedProfesor} onChange={(e) => setSelectedProfesor(e.target.value)}>
                    <option value="">Seleccionar Profesor</option>
                    {profesores.map(profesor => (
                        <option key={profesor.id} value={profesor.id}>{profesor.nombre}</option>
                    ))}
                </select>
            </div>
            <div>
                <label>Asignatura:</label>
                <select value={selectedAsignatura} onChange={(e) => setSelectedAsignatura(e.target.value)}>
                    <option value="">Seleccionar Asignatura</option>
                    {asignaturas.map(asignatura => (
                        <option key={asignatura.id} value={asignatura.id}>{asignatura.nombre}</option>
                    ))}
                </select>
            </div>
            <div>
                <label>Carrera:</label>
                <select value={selectedCarrera} onChange={(e) => setSelectedCarrera(e.target.value)}>
                    <option value="">Seleccionar Carrera</option>
                    {carreras.map(carrera => (
                        <option key={carrera.idCarrera} value={carrera.idCarrera}>{carrera.nombreCarrera}</option>
                    ))}
                </select>
            </div>
            <div>
                <label>Facultad:</label>
                <select value={selectedFacultad} onChange={(e) => setSelectedFacultad(e.target.value)}>
                    <option value="">Seleccionar Facultad</option>
                    {facultades.map(facultad => (
                        <option key={facultad.idFacultad} value={facultad.idFacultad}>{facultad.nombreFacultad}</option>
                    ))}
                </select>
            </div>
            <button onClick={handleSubmit}>Buscar Encuestas</button>
        </div>
    );
};

export default SurveyResponse;
